with filtered_granularity as (
    select granularity
    from MD.FATPAY_DASHBOARD_HELP_TABLE
    where {{granularity}}
          AND granularity is not null
),

filtered_fatpay as (
    select 
        CREATED_AT,
        AMOUNT_EUR,
        ORDER_ID
    from MART.FATPAY
    where -- IS_CARD_BINDING = FALSE and IS_REPEAT = FALSE and 
        {{CREATED_AT}}
        and {{CARD_GEOSCHEME}}
        and {{CARD_COUNTRY}}
        and {{STATUS}}
        and {{BUSINESS_NAME}}
        and {{USER_NAME}}
        and {{FIAT_CURRENCY}}
        and {{ACQUIRER}}
        and {{CARD_BRAND}}
        and {{PAYMENT_TERMINAL}}
        and {{ERROR_GROUP}}
        and {{ERROR_NAME}}
        and {{HAS_ID_PROVIDER}}
        and {{SHOP}}
        and {{is_aft}}
        and day(created_at) <= {{day_number}}
)

select 
    date_trunc(fg.granularity, ff.CREATED_AT) as created_at,
    'transactions' as tt,
    count(distinct ORDER_ID) as count_transactions
from filtered_fatpay as ff
left join filtered_granularity as fg
    on 1 = 1
group by 1, 2

